#Database Properties File
#
#The following values must be set before installation at a customer site.
#
#Define Database Variables
#-------------------------
#
#Define Database Table Attributes
#Each Entry consists of the following fields:
#
#1 - TableID = 4 character table id
#2 - TableName = 7 character Name of database table
#3 - Test Primary Query Plan = 1 character Query plan for test primary
#4 - Load Query Plan = 1 character Query plan for load
#5 - Browse Query Plan = 1 character Query plan for browse prepared statement
#6 - Optimize Rows = 3 character Number of rows to optimize
#7 - Database = 1 character Database Vendor (D=DB2/P=PostgreSQL/S=SQL Server/O=Oracle)
#                                           (Z=DB2 PF ONLY/Y=PostgreSQL PF ONLY/X=SQL Server PF Only/W=Oracle PF Only)
#                                           (E=DB2/Q=PostgreSQL/T=SQL  Server/R=Oracle Remote Database)
#8 - UpdateRule = 1 character indicator to store updates for end of task (0=No,1=Yes,
#                                                                         2=Yes and key will be made unique at end of task)
#9 - Swapable Rule = 1 character indicator that the table is swapable (0=No,1=Yes)
#
#See bottom of page for Defined Query Plans

